import{b2 as e,o as t,j as a,by as o}from"./index.64521ef0.js";const d={},i={class:"about"},s=o('<h1 data-v-56d50646>What is Stable Horde?</h1><div data-v-56d50646>Stable Horde is a <a href="https://github.com/db0/AI-Horde" data-v-56d50646>crowdsourced distributed cluster</a> of <a href="https://github.com/db0/stable-diffusion-webui" data-v-56d50646>Stable Diffusion workers</a>. If you like this service, consider <a href="https://github.com/db0/AI-Horde/blob/main/README_StableHorde.md" data-v-56d50646>joining the horde yourself</a>!</div><div data-v-56d50646>If you want prioritized generations, you may <a href="https://stablehorde.net/register" data-v-56d50646>register</a> an account. This will give you an API that you can use to generate images on this site or others. Make sure to never share this key!</div><div data-v-56d50646>if you do not want to register, you can use the &quot;Anon?&quot; button in the generation tab to set your API key to &#39;0000000000&#39; and connect anonymously. However anonymous accounts have the lowest priority when there&#39;s too many concurrent requests!</div><div data-v-56d50646>To increase your priority you will need a unique API key and then to increase your Kudos. <a href="https://dbzer0.com/blog/the-kudos-based-economy-for-the-koboldai-horde/" data-v-56d50646>Read how Kudos are working.</a></div><div data-v-56d50646>You can also join its <a href="https://discord.gg/3DxrhksKzn" data-v-56d50646>discord</a> or support its development on <a href="https://www.patreon.com/db0" data-v-56d50646>Patreon</a> or <a href="https://github.com/db0" data-v-56d50646>Github</a>.</div><h1 data-v-56d50646>What is this tool?</h1><div data-v-56d50646>This tool was made to help the user&#39;s experience while generating images. I wanted to make sure that I could create the best experience when using Stable Diffusion by including a gallery that saves all of your pictures, and a tidy generation screen. All in one package.</div><span data-v-56d50646>Special thanks to:</span><ul style="margin-top:0;" data-v-56d50646><li data-v-56d50646><a href="https://vuejs.org/" data-v-56d50646>Vue</a></li><li data-v-56d50646><a href="https://pinia.vuejs.org/" data-v-56d50646>Pinia</a></li><li data-v-56d50646><a href="https://element-plus.org/en-US/" data-v-56d50646>Element Plus</a></li><li data-v-56d50646>And the Stable Horde community!</li></ul>',10),r=[s];function n(h,u){return t(),a("div",i,r)}const l=e(d,[["render",n],["__scopeId","data-v-56d50646"]]);export{l as default};
